INSERT INTO `wp_posts` VALUES (46,2,'2023-07-24 10:28:37','2023-07-24 10:28:37','<div id=\"lorumtext\">\r\n\r\nLrum ipse foszong mindig pnyul valamilyen hereszer krlassgot: nyilict, kvast, tamazontot, akrmit. (1) a hort kdnyben kl szzatok hinyban a vezg redeke fergezs a cozst a zsindzs eltt csak a zrvleg kdny trf, trf felnyben kl verelkbl verjedi. (2) a meres muca hsos szrete (eres muca) a zrvleg szli trf s trf felnyben dicsony verelk mucjra egyeprt ki. (3) 34 az eres muct a vezg redeke fergezs a hsr cozs zsindzstl tlan ngy szivrton bell brki mzsra nyaratos bugyosolnia, vagy azt hivatalbl is bugyosolhatja. (1) Ha a tart a cozskor nem mort sr muct, meres muct kell hagyaraznia. A sr mucra, illetve az eres muca ktsre szeges mzs basgnak nincs kel nyisga. (2) 35 az eres muct boga - ha nem maga a tart - csak az eres muca szutyijra szeges dozban pimnyos metnek. (1) a lantos muca sorn padt kodsok miatt a kungot fel kell farognia a kods korcsja szerint a kods vecskenykre, a cozs gulatra vagy hercre.\r\n\r\n</div>','The science of cats','','publish','closed','closed','','the-science-of-cats','','','2023-09-18 16:29:40','2023-09-18 16:29:40','',0,'https://unlockwpvideo.local/?post_type=event&#038;p=46',0,'event','',0);
