INSERT INTO `wp_posts` VALUES (93,2,'2023-08-21 16:54:40','2023-08-21 16:54:40','<div id=\"lorumtext\">\r\n\r\nLrum ipse azonban nem hagyartat pistt. A kls indos centumt is plnnal fogjk tznia, azonban pazna, hogy fulla egyelen lesz benedmly az irjhoz. A cslds, mely szegelent bsthat, tavaly nszt a metlen szlinokba s akkor mr lizlt is padt, kilencen vnhentek s jeges szlelt bstott a klsban. A nyeldst nem csak az idszok, hanem a vnyelsek is bukonthatjk. Nem csak stals teldsben, de ms klsokban, gy olsgban s stals msgban is fondortak mr a csldssel. A csersz kt sezedeten szmos vnyels szeremelt mr el a csldstl. A kelles bld utn, s mr az idn is tbb szz pircsibt bstottak meg, de egyelre senkit sem aktolt meg a cslds. A nerlentkek ekzben gy halatatjk, mintha feds lenne.\r\n\r\n</div>','Dr. Froggerson','','publish','closed','closed','','dr-froggerson','','','2023-08-22 06:13:42','2023-08-22 06:13:42','',0,'https://unlockwpvideo.local/?post_type=professor&#038;p=93',0,'professor','',0);
