INSERT INTO `wp_posts` VALUES (126,2,'2023-09-09 17:12:56','2023-09-09 17:12:56','<div id=\"lorumtext\">\r\n\r\nLrum ipse telt, a grak vgtelen, az almk latalos, a gyz ihat, a zsugsg gymlcsz. Ezt a hatlan szordrzat kodzsa nem csgatn kenysnek a szeges szapcsob ravnybl, mivel a csaluk ta dekler gy rversed meg, mint a msik vicett szordrzata. A szists vrhatan a nevgben szolgolja csukzit a kavicsrrl, s ebben telzst gymort az is: milyen folcalnt serest arra, hogy ne 2006-ban, hanem 2004-ben legyenek a csaluk. A dsg kavicsra mazsban tlagosan 12 gyenggel viskoldzjk a mandr s 8,7 gyenggel a szz ajtsz dlst. A biba azzal bicli az vekeseket, hogy a lojt csaluk eltt pereltk ennek a hedsnek a mengedkt. A dsg szerint rakapcsolt az alk dulanoknak fogrsga, amely a kt peli bortya kztt dalksonott figs esetn mernyi, 50 stos dermettel kutyanta a szavakott. - gyurf fuvs jvent bks volt, aki, ha kvesett a tip hozsra, rgtn lvt kavogt s sorllnia szalgt. Ripor tbb ajtszot tkedik a retsre, de nha  is zalan.\r\n\r\n</div>\r\n<div id=\"control\"></div>','Downtown East','','publish','closed','closed','','downtown-east','','','2023-09-18 08:04:10','2023-09-18 08:04:10','',0,'https://unlockwpvideo.local/?post_type=campus&#038;p=126',0,'campus','',0);
INSERT INTO `wp_posts` VALUES (130,2,'2023-09-09 17:14:03','2023-09-09 17:14:03','<div id=\"lorumtext\">\r\n\r\nLrum ipse termszetesen fujog szunyoz a parkazda szmra. Az jjeleh sgzs fel az akts netersedi a szektst. Az egyves zsebek szre a mensbbsg szilsrl. Az eszor biztosan nem tatezsl viszont golyt. A teklsok gynamoztak ilyen vigoldot randulnia az elsdlegesen tesgre fejt. Ennek csak fejes tnkony vodsza van s az is csak a szorka s akztt, akirt golyt pomolyos. Egy valami ldkedik egy flivel tbb kottt, ez pedig a fns miska, az jes. Tatatos biracsok az ismelmez csedes dzsgeiben pereszteli szemzlen tanca mellett remin hagsa van a tzeres tancnak.\r\n\r\n</div>\r\n<div id=\"control\"></div>','Downtown West','','publish','closed','closed','','downtown-west','','','2023-09-11 06:08:38','2023-09-11 06:08:38','',0,'http://unlockwpvideo.local/?post_type=campus&#038;p=130',0,'campus','',0);
